import React from 'react';
import s from './escort.module.scss';
import Slider from "react-slick";
import m1 from '../../assets/images/main/vertical/model-1.png';
import m2 from '../../assets/images/main/vertical/model-2.png';


export default function EscortGrid() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 4,
    arrows: false,
    dots: false,
    rows: 4
  };

  return (
    <div style={{
      maxWidth: '1260px',
      margin: '0 auto'
    }} >
      <Slider {...settings}>
        <div className={s.vertical_slide}>
          <div>
            <img src={m1} alt="model" className="w-100" />
          </div>
          <div className={s.vertical_slide_model_info}>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Aliquid tempore et recusandae iste velit aliquam error, illum quos dolor! Tenetur id officiis dolorum animi amet voluptatibus impedit cumque adipisci maiores.
          </div>
        </div>
        <div>
          <img src={m2} alt="model" className="w-100" />
        </div>
      </Slider>
    </div>
  )
}
